import React, {useEffect, useState} from 'react';
import styles from './App.module.css';
import Calendar from './components/Calendar';

function App() {

 const [backgroundImage, setBackgroundImage] = useState('aut1');

  useEffect (() => {
    document.body.classList.add(styles.aut1);
  }, []);

  return <div>
    <header>Календар - чекліст</header>
    <main>
          <Calendar setBackgroundImage = {setBackgroundImage} />
    </main>
  </div>
}

export default App;
